import { createGlobalStyle } from 'styled-components';

import ThemifyTTF from './themify.ttf';

export default createGlobalStyle`
    @font-face {
        font-family: 'Themify';
        src: url(${ThemifyTTF}) format('ttf');
        font-weight: ${fontWeight.bold};
        font-style: normal;
    }
`;
